B.Fp=new A.eP("Yale Young African Scholars (YYAS) Outreach","assets/images/yyas.jpg","2019","YYAS It is a cost-free intensive academic enrichment and leadership program designed for African secondary school students who have demonstrated high academic potential and show interest in community engagement with a passion for Africa's growth. It is organized by Yale University and Funded by Higher Life Foundation.\n\nBeing a YYAS alumnus, during my final year of high school, I distributed flyers, wrote blog posts, and organized information sessions together with a fellow alumnus, all in a bid to empower Cameroonian students with the information they need to make well-informed decisions regarding their tertiary education. During one of the information sessions, we invited Mr. Lenjo Valery: CEO at Lenjval Technologies, and Mr. Fonban Emmanuel: filmmaker and publisher at the Astute Inc, who held talks titled \u201cThe African Agripreneurial Mindset\u201d and \u201cNetworking in New Environments\u201d respectively.","https://africanscholars.yale.edu/")
